import React from "react"
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import'./App.css';

import Register from "./page/Register/Register"

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/register" element={<Register/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
